import isAuthenticated from "../components/auth/Register";

const Header = () => {

    return (
<Wrapper>
      <div>  { loadUser ? (
        <button type="button" class="logout btn btn-primary" onClick={e => onlogoutClick(e)}>
                Log Out
               </button> )  : ( "" )};
      </div>
     
       
    

      <nav class="navbar sticky-top">
        <a class="navbar-brand" href="">Scart</a>
          <Logout />   
      </nav>
    </Wrapper> 
  )   
};

export default Header;
